import { useParams } from "react-router-dom"

export const Agaram=()=>{
    return(
        <>
            <h1>World best literature</h1>
        </>
    )
}

export const Thenali=()=>{
    return(
        <>
            <h1>Assembly poet from vijayanagar emperium</h1>
        </>
    )
}

export const Vikatan=()=>{
    const{}=useParams()
    return(
        <>
            <h1>Weekly article which has few garbages</h1>
        </>
    )
}
